import React from "react";
import Video from "../../videos/MVI_0358.mp4";
import {
  ActionContainer,
  ActionBg,
  VideoBg,
  ActionContent,
  ActionH1,
  ActionP,
} from "./ActionElements";

export const ActionSection = () => {
  return (
    <ActionContainer>
      <ActionBg>
        <VideoBg autoPlay loop muted src={Video} type="video/mp4" />
      </ActionBg>
      <ActionContent>
        <ActionH1>
          개발자,<pr></pr> 어떤 사람이여야 될까요?
        </ActionH1>
        <ActionP></ActionP>
      </ActionContent>
    </ActionContainer>
  );
};
